window.bookSummaryJSON = "<p>As Connor secretly searches for the enemy homeworld, he launches clandestine military operations to liberate other worlds in hopes of gaining allies before the enemy can find the last human colony.</p> <p>The humans cannot hope to compete with the enemy’s vast empire, but with the discovery of a new ally, Connor believes their luck has finally changed.</p> <p>Instead, when new allies clash with the old, Connor finds himself caught in the middle. Connor will have to choose whether doing what’s necessary to ensure the colony survives is worth compromising his loyalty to allies close to home, but the price could ultimately tear the colony apart.</p> <p>Surviving a war with the enemy isn’t always a numbers game, but in choosing one ally, will Connor lose it all?</p> <p><i>Insurgent</i> is the tenth book in the best-selling military science fiction series, First Colony. Listen to the 10th book of this epic today!</p> <p><b>First Colony Series</b></p> <ul> <li>Book 1 - <i>Genesis</i></li> <li>Book 2 - <i>Nemesis</i></li> <li>Book 3 - <i>Legacy</i></li> <li>Book 4 - <i>Sanctuary</i></li> <li>Book 5 - <i>Discovery</i></li> <li>Book 6 - <i>Emergence</i></li> <li>Book 7 - <i>Vigilance</i></li> <li>Book 8 - <i>Fracture</i></li> <li>Book 9 - <i>Harbinger</i></li> </ul>"; 
